import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom'
import Users  from './users/components/Users'

function App() {
  return (
    <Router>
   <Route path="/" exact>
   <Users></Users>
   </Route>
   <Redirect to="/"/>
  </Router>
  )
}

export default App
